```', 'comment_created': datetime.datetime(2020, 7, 21, 12, 41, 39, tzinfo=datetime.timezone.utc), 'commenter': 'kingthorin', 'type': 'User'}, {'comment_id': 458068873, 'comment_body': "There are probably core constants for a bunch of these, check `HttpHeader` etc. (Maybe not the content types, but the HTTP declaration and header field names I'm pretty sure about). Maybe make local constants for the content types.", 'comment_created': datetime.datetime(2020, 7, 21, 12, 48, 30, tzinfo=datetime.timezone.utc), 'commenter': 'kingthorin', 'type': 'User'}, {'comment_id': 458691409, 'comment_body': 'They are part of the spec: http://spec.graphql.org/draft/#sec-Scalars.Built-in-Scalars', 'comment_created': datetime.datetime(2020, 7, 22, 10, 23, 12, tzinfo=datetime.timezone.utc), 'commenter': 'ricekot', 'type': 'User'}, {'comment_id': 458695263, 'comment_body': 'Okay great.', 'comment_created': datetime.datetime(2020, 7, 22, 10, 30, 45, tzinfo=datetime.timezone.utc), 'commenter': 'kingthorin', 'type': 'User'}, {'comment_id': 462235399, 'comment_body': 'I think these should have trailing colons `:` to be more consistent with other options panels.', 'comment_created': datetime.datetime(2020, 7, 29, 11, 41, 56, tzinfo=datetime.timezone.utc), 'commenter': 'kingthorin', 'type': 'User'}, {'comment_id': 462236662, 'comment_body': 't seems like this is being done in every test. Should it be being done in the code somewhere? Or does it indicate an issue with the generator?', 'comment_created': datetime.datetime(2020, 7, 29, 11, 44, 35, tzinfo=datetime.timezone.utc), 'commenter': 'kingthorin', 'type': 'User'}, {'comment_id': 462255036, 'comment_body': "Seems like this isn't required anymore. I had put it there originally because the generator was adding spaces and newlines for pretty printing each query. But since the pretty printing is actually pointless (because the escape characters show as-is as part of a JSON string in the request editor), I had removed all of them, but forgot to update the tests. Good catch; I'll update the tests.", 'comment_created': datetime.datetime(2020, 7, 29, 12, 19, 27, tzinfo=datetime.timezone.utc), 'commenter': 'ricekot', 'type': 'User'}, {'comment_id': 462258008, 'comment_body': 'Okay no worries.', 'comment_created': datetime.datetime(2020, 7, 29, 12, 24, 51, tzinfo=datetime.timezone.utc), 'commenter': 'kingthorin', 'type': 'User'}]
